import './sidebar.scss';


const Sidebar = () => {
    return(
        <div className="sidebar">
            <div className="sidebar__user">
                <div className="sidebar__user-profile">
                    <img src=""></img>
                </div>
                <div className="sidebar__user-info">
                    <img src=""></img>
                </div>
            </div>
        </div>
    ); 
}

export default Sidebar;
